import React from "react";
import { Route, Routes } from "react-router-dom";
import styles from './phoneRepair.module.css';
import PhoneModel from "../PhoneModel/PhoneModel";

const model = {
    iPhone: ['iPhone 3', 'iPhone 4', 'iPhone 5', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone 9'
            , 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 13']
}


const phoneRepair = (props) => (
    <div className={styles.Main}>
        <Routes>
            <Route path="/model" element={<PhoneModel model={model.iPhone}/>}/>
        </Routes>
            <img src={props.img} />
            <p>{props.model}</p>
    </div>
)

export default phoneRepair;
